import React, { useEffect } from "react";
import { connect } from "react-redux";
import SongItem from "./SongItem";
import PropTypes from "prop-types";
import { getSongs } from "../actions/songs";

const Songs = ({ song: { songs, loading }, getSongs, addSong }) => {
  useEffect(() => {
    getSongs();
  }, []);

  return (
    <ul className="collection with-header">
      <li className="collection-header">
        <h4 className="center">Songs</h4>
      </li>
      {!loading && songs.length === 0 ? (
        <>
          {" "}
          <p className="center">You have no songs</p>
          <div style={{ marginLeft: "48%", paddingBottom: "5%" }}>
            <a
              href="#add-log-modal"
              className="btn-floating green darken-1 modal-trigger"
            >
              <i className="material-icons">note_add</i>
            </a>
          </div>
        </>
      ) : (
        songs.map((song) => <SongItem song={song} key={song.songId} />)
      )}
    </ul>
  );
};

Songs.propTypes = {
  song: PropTypes.object.isRequired,
  getSongs: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  song: state.song,
});

export default connect(mapStateToProps, { getSongs })(Songs);
